import Tabla from "./Tabla";
function Usuarios() {
    if (localStorage.getItem('privilegio') == '1') {
        const tabla = 'usuarios';
        async function Buscar_data() {
            try {
                const response = await fetch('http://localhost:4000/' + tabla);
                if (response.ok) {
                    response.json().then(data => render(data))
                } else {
                    console.log('No render');
                }
            } catch (error) {
                console.log(error);
            }
        }
        Buscar_data();
    
        function render(data) {
            <h2 className="ml-3 text-center" style={{ color: "green" }}>{{tabla}}</h2>
    
        }
    
        return (
            <div>
                <Tabla tabla={"usuarios"}></Tabla>
            </div>
        );
    } else {
        window.location = 'http://localhost:3000/Libros';
    }

}

export default Usuarios;
